import React from "react";
import ProfileInfo from "./ProfileInfo/ProfileInfo";
import MyPostsCotainer from "./MyPosts/Post/MyPostsContainer";

const Profile = (props) => {

  return (
    <div>
      <ProfileInfo />
      <MyPostsCotainer posts = {props.profilePage.posts} newPostText={props.profilePage.newPostText} dispatch={props.dispatch}/>
    </div>
  );
};

export default Profile;
